              style={{ height: 80, width: 'auto' }}
              alt='explore1'
            />
            <p class='pl-4'>Stays</p>
          </div>
        </div>
        <div className='lg:w-1/3 '>
          <div className='mr-4 flex flex-wrap items-center justify-start shadow-xl rounded-lg bg-white'>
            <img
              src={img1}
              className='rounded-xl rounded-r-none'
              style={{ height: 80, width: 'auto' }}
              alt='explore2'
            />
            <p class='pl-4'>Stays</p>
          </div>
        </div>
        <div className='lg:w-1/3 '>
          <div className='mr-4 flex flex-wrap items-center justify-start shadow-xl rounded-lg bg-white'>
            <img
              src={img1}
              className='rounded-xl rounded-r-none'
              style={{ height: 80, width: 'auto' }}
              alt='explore3'
            />
            <p class='pl-4'>Stays</p>
          </div>
        </div>
      </div>
    </div>
  );
};
